import React from "react";
import Introduction from "../SolarChecker/pages/introduction";
import './SolarChecker.css';
import Result from "../SolarChecker/pages/result";
import { useSelector } from "react-redux";
import { pageInfo } from "../Store/inputDataSlice";

export default function SolarChecker(props) {

  console.log(props.state);

  let pageToDisplay = useSelector(pageInfo);

  return (
    <div>
      {pageToDisplay === 1 && <Introduction version={props.version} />}
      {pageToDisplay === 2 && <Result version={props.version} />}
      <footer>
        <p>&copy; 2024 Rishabh Goel. All rights reserved. V1.1</p>
      </footer>
    </div>

  );
}
